import {h, app} from "hyperapp"
import './style.css'
import Header from "./Header"

const state = {
	header: {
		logo: "img/logo.png"
	}
}
const actions = {}
const view = state => <h1>{Header(state.header)}</h1>

app(state, actions, view, document.body)
